  true,\n\t\"url\": null,\n\t\"notes\": \"Enterprise configuration management (CM
  )will provide all IT management domains with a complete, common understanding of
  business services. It will accelerate incident and problem management and mitigate
  risks of changes. Enterprise CM defines relationships between data elements, which
  make data more relevant. An automated enterprise level CMS will align with the systems
  and applications identified in the Technical Reference Model (TRM). Enterprise CM
  will minimize change impact and accelerate problem isolation with detailed configuration
  information. Current and future Service Level Agreements (SLA) and Operating Level
  Agreements (OLA) will be better aligned to meet business needs.\",\n\t\"license_title\":
